Items/DebitCard.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.4.22 <0.9.0;

import "./VaultItem.sol";
import "../Libs/Constants.sol";

contract DebitCard is VaultItem{

    string card_id;
    string name_on_card;
    uint16 expire_at;
    uint16 cvv;

    constructor(
        string memory _name,
        string memory _card_id,
        string memory _name_on_card,
        uint16 _expire_at,
        uint16 _cvv,
        address _owner,
        address _parent
    ) VaultItem(
        _name,
        Constants.ItemType.DEBIT_CARD,
        _owner,
        _parent
    ){

        card_id = _card_id;
        name_on_card = _name_on_card;
        expire_at = _expire_at;
        cvv = _cvv;

        emit Created(msg.sender);
    }


    function setCardId(string memory _card_id) external ownerOnly {
        card_id = _card_id;

        emit Updated(msg.sender);
    }

    function setNameOnCard(string memory _name_on_card) external ownerOnly {
        name_on_card = _name_on_card;

        emit Updated(msg.sender);
    }

    function setExpireAt(uint16 _expire_at) external ownerOnly {
        expire_at = _expire_at;

        emit Updated(msg.sender);
    }

    function setCvv(uint16 _cvv) external ownerOnly {
        cvv = _cvv;

        emit Updated(msg.sender);
    }

    function setItem(
        string memory _n,
        string memory _c_id,
        string memory _noc,
        uint16 _e_at,
        uint16 _cvv
    ) external ownerOnly {

        name = _n;
        card_id = _c_id;
        name_on_card = _noc;
        expire_at = _e_at;
        cvv = _cvv;

        emit Updated(msg.sender);
    }

    function expose() external view ownerOrShared returns (string memory, string memory, string memory, uint16, uint16) {
        return ( name, card_id, name_on_card, expire_at, cvv );
    }


}

Libs/Constants.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.4.22 <0.9.0;


library Constants{

    enum ItemType{ LOYALITY_CARD, DEBIT_CARD, PASSWORD, CHAT }


    function isValidItemType(uint8 _t) internal pure returns (bool) {
        return _t < uint8(ItemType.PASSWORD) + 1;
    }

    function findAddressIndex(address _addr, address[] memory _a) internal pure returns (int) {
        for (uint i = 0; i < _a.length; i++) {
            if (_a[i] == _addr) return int(i);
        }
        return -1; 
    } 

    function deleteAddressFrom(int idx, address[] storage _a) internal {
        require(idx >= 0 && uint(idx) < _a.length, "No idx");
        for (uint i = uint(idx); i < _a.length - 1; i++) {
            _a[i] = _a[i + 1];
        }

        _a.pop();
    }

}

Items/VaultItem.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.4.22 <0.9.0;

import "../Interfaces/Item.sol";
import "../Libs/Constants.sol";

abstract contract VaultItem is Item{

    string name;
    Constants.ItemType item_type;

    address owner;
    address parent;
    address[] sharedWith;


    modifier ownerOnly{
        require(msg.sender == owner || msg.sender == parent, "Only owner");
        _;
    }
    modifier ownerOrShared{
        require( msg.sender == owner || Constants.findAddressIndex( msg.sender, sharedWith ) != -1, "Restrict");
        _;
    }

    constructor(
        string memory _n,
        Constants.ItemType _item_type,
        address _o,
        address _p
    ){
        name = _n;
        item_type = _item_type;

        owner = _o;
        parent = _p;
    }

    function isOwn() external view  returns (bool) {
        return msg.sender == owner || msg.sender == parent;
    }

    function getItemType() external view ownerOnly returns (Constants.ItemType) {
        return item_type;
    }

    function setName(string memory _n) external ownerOnly {
        name = _n;

        emit Updated(msg.sender);
    }

    function getParent() external view ownerOnly returns (address) {

        return parent;
    }

    function setParent( address _p) external  ownerOnly {
        parent = _p;

        emit Updated(msg.sender);
    }

    function isSharedWith() external view returns (bool) {
        return Constants.findAddressIndex( msg.sender, sharedWith ) != -1;
    }

    function getSharedWith() external view ownerOnly returns (address[] memory) {
    
        return sharedWith;
    }

    function shareWith(address _w) external ownerOnly {

        require( _w != owner && _w != address(0) && Constants.findAddressIndex( _w, sharedWith ) == -1, "Forbidden");

        sharedWith.push(_w);

    }

    function restictFrom( address _f ) external {
        
        require(_f != address(0) || ( msg.sender == parent || msg.sender == owner || msg.sender == _f ), "Forbidden");

        int _idx = Constants.findAddressIndex( _f, sharedWith );

        require(_idx > -1, "Not found");

        Constants.deleteAddressFrom( _idx, sharedWith );

    }



}

